import React from 'react';
import Quadrant from './Quadrant';

const Options = ({ handleOnClick }) => {
  const options = {
    Soundscape: ['Music', 'Nature', 'Rain', 'Celestial', 'Beach', 'Chimes', 'Storm', 'White Noise'],
    Language: ['English', 'Español', 'Deutsch', 'Français', 'Italiano', 'Português', 'Polski', 'Русский'],
    Duration: ['5', '10', '15', '20', '30', '45', '60', '∞'],
    Voice: ['Willow', 'Atlas', 'Daniel', 'Ester'],
  };

  return (
    <div className="options-container">
      {Object.entries(options).map(([key, value]) => (
        <Quadrant key={key} title={key} options={value} handleOnClick={handleOnClick} />
      ))}
    </div>
  );
};

export default Options;
